INSERT INTO `bbs_discuss_description` (`discuss_id`, `language_id`, `content`) VALUES
(5, 1, '@xcalder 建议按照业务需求和操作需求来判断吧，如果自适应能满足也无妨，不行就只能单独页面了。'),
(6, 1, '<p>@雨泽</p><p>看了你的配置，可能是缓存驱动器还没配置，session 存储不正常</p><p>你看下把public/config/config.php  中有个session 附近设置一下</p>'),
(7, 1, '<p>@雨泽</p><p>7.1以后的php版本，session 好像就是有问题，用7.0.23之前的版本试试吧</p>');
