INSERT INTO `bbs_plate_description` (`plate_id`, `language_id`, `title`, `description`) VALUES
(1, 1, '教程', '<p>已知问题和开发使用技巧，把你的经验或方法分享给更多的人，你就是社区一个不可或缺的重要参与者！</p>'),
(3, 1, '问答', '<p>不管你是一个使用者，还是一个开发者，如果你有一个不能处理或是一时找不到方法头绪的烦恼，你可以在这里发问，相信社区的力量，缔造一个更加完善的开源项目<br></p>'),
(4, 1, '招聘', '<p>如果你有需求，你完全可以在我们这个专业的开源项目社区录找你中意的phper,不管你是不是正在使用或即将使用OpenAant项目，或者用OpenAnt项目盈利！<br></p>'),
(5, 2, '文档', '<p>Openant based on the ci framework development, naturally, our document transplant from ci framework manual, and manual and openant projects, we need a little bit perfect!<br></p>'),
(6, 1, '酷站', '<p>把你的网站帖出来吧，让更多的开发者或者使用者为你的设计尖叫，感受你的与众不同！<br></p>'),
(7, 1, '反馈', '<p>有关bug反馈修复回复在这里提交和公布，这是一个开源且免商业授权的项目，人人都可以参与开发，提交合并给我们，每一个反馈都会受到众多开发者的重视。</p>'),
(7, 2, 'Feedback', '<p>Feedback on bugs feedback Fixes are posted and published here. This is an open source, commercial license-free project that everyone can participate in and submit to merge. Every feedback is valued by many developers.<br></p>'),
(1, 2, 'Official release', '<p>Known issues and the development of the use of skills, your experience or methods to share to more people, you are an indispensable and important community of participants!</p>'),
(3, 2, 'Answers', '<p>Whether you are a user, or a developer, if you have a can not handle or can not find the clue of the troubles, you can ask questions here, I believe the power of the community to create a more complete open source project<br></p>'),
(4, 2, '招聘', '<p>If you have a need, you can in our professional open source project community to find your favorite phper, whether you are not using or about to use OpenAant project, or use the OpenAnt project profit!<br></p>'),
(5, 1, '文档', '<p>openant基于ci框架开发，自然的，我们的文档移植自ci框架手册，并且手册和openant项目一样，需要我们一点点完善！<br></p>'),
(6, 2, '酷站', '<p>Put your website stickers out, so that more developers or users for your design screaming, feel your different!<br></p>');
