INSERT INTO `bbs_posting_description` (`posting_id`, `language_id`, `title`, `description`) VALUES
(7, 1, '【安装教程】安装器文件权限检测不完善问题,暂时需手动修改！', '<h5>安装需要把如下文件/文件夹权限设为可写状态才能安装成功</h5>\r\n<p>注：linux 下安装才需要权限问题</p>\r\n\r\n<p>可写目录：</p>\r\n<p>image</p>\r\n<p>upload</p>\r\n\r\n<p>可写文件：</p>\r\n<p>入口文件：</p>\r\n<p>index.php</p>\r\n<p>admin.php</p>\r\n<p>install.php</p>\r\n<p>sale.php</p>\r\n\r\n<p>配置文件：</p>\r\n<p>admin/config/config.php</p>\r\n<p>sale/config/config.php</p>\r\n<p>catalog/config/config.php</p>\r\n\r\n<p>数据库文件：</p>\r\n<p>admin/config/database.php</p>\r\n<p>sale/config/database.php</p>\r\n<p>catalog/config/database.php</p>\r\n\r\n<p>然后一步步往下安装就行了</p>'),
(8, 1, '测试数据多店铺自动拆单后商品/订单丢失问题', '<h5>这个问题可能也不叫缺陷</h5>\r\n\r\n<p>问题原因：</p>\r\n\r\n<p>由于测试数据的数据库中我把store(商店)表多余的商家删除掉了，添加订单查不到商店数据，只要把product相关的表记录删除，再（在商家入驻）添加店铺就正常了</p>'),
(9, 1, '部分功能页面user_id报错问题', '<p>这个问题和订单丢失问题一样，因为测试数据中的测试用户数据被删除了部分功能调取不到，所以报错！</p>'),
(10, 1, '权限管理已经完成了，注册用户不能再访问和修改后台，反馈bug帖', '<p>目前，项目的权限管理已经完成了，注册用户不能再访问和修改后台，后面我会添加一个demo帐号，可以查看（不能修改）所有功能<br></p>'),
(13, 1, '修改发帖和回复为编辑器，可以上传图片了，bug反馈帖', '<p><img src="resources/image/users/2016/02/02/1/bug/20161008111032EYHK3dXytb.png"><br></p><p>修改发帖和回复为编辑器，可以上传图片了，bug反馈帖<br></p>'),
(11, 1, '立即购买按钮和添加收藏夹按钮，测试反馈来这里回复给我就行了', '<p>立即购买按钮和添加收藏夹按钮功能已经完成了，测试反馈来这里回复给我就行了</p>'),
(12, 1, 'meta_keyword自动分词，如有报错来这里回复我', '<p>前台页面的meta_keyword引入了一个自动分词类库，如有报错来这里回复我修复</p>'),
(14, 1, '报错页面提交', '<p>如果你在浏览本站点过程中遇到了报错的页面，请在这里提交给我们处理</p>'),
(15, 1, '正式版本发布前，如果你对本项目有什么想法，请告诉我们', '<p><img src="resources/image/users/2016/02/02/1/bug/20161008111031SuLsiRDh3G.jpg"><br></p><p>正式版本发布前，如果你对本项目有什么想法，请告诉我们<br></p>'),
(16, 1, '最新版本openant手动安装教程', '<p>此方法已不适用最新版本，最新安装教程请稳步：<a href="https://www.openant.com/bbs/index.php/community/posting?posting_id=23" target="_blank">https://www.openant.com/bbs/index.php/community/posting?posting_id=23</a></p><p>1、下载文件，分清对应的入口和应用文件夹<br></p><p>admin应用入口admin.php</p><p>catalog（前台应用）入口index.php</p><p>sale(商用应用)入口sale.php</p><p>2、修改各入口文件（index.php、admin.php、sale.php）的安装子目录路径，第229行：</p><pre>// Path to the Subdirectory (this file)\r\ndefine(''SUBPATH'', '''');//子目录路径，如：http://www.openant.com/aa/cc/bb/dc/,填写''aa/cc/bb/dc/''; <br></pre><p>3、修改各应用下的配置文件，（路径：应用/config.php）：注：只改这两处，其它不改</p><p>catalog/config/config.php、sale/config/config.php、admin/config/config.php第26行</p><pre>$config[''base_url''] = '''';//当前域名,如：http://www.openant.com,如果在子目录下：http://www.openant.com/子目录1/子目录2/<br></pre><p>catalog/config/config.php、sale/config/config.php、admin/config/config.php第394行<br></p><pre>$config[''cookie_domain''] = ''openant.com'';//cookie域名，不加www，不加http<br></pre><p>4、使用phpmyadmin导入根文件夹下的openatn.sql文件，修改catalog/config/database.php、sale/config/database.php、admin/config/database.php第9——14行，其它不改否则出错</p><pre> ''hostname'' => ''openant.localhost'',//一般改成localhost\r\n ''username'' => ''openant.username'',//数据库用户名\r\n ''password'' => ''openant.password'',//数据库密码\r\n ''database'' => ''openant.database'',//数据库名\r\n ''dbdriver'' => ''openant.dbdriver'',//mysql驱动，一般改成  mysqli\r\n ''dbprefix'' => ''openant.dbprefix'',//表前缀，目录只能改为空<br></pre><p>好了现在你应该可以从你安装程序的域名或路径访问首页了</p>'),
(17, 1, '命名规则', '<p>请注意，如果你是有linux服务器上开发、安装、使用openant那么文件命名显得十分重要。</p><p>1、所有文件夹名小写</p><p>2、controllers 控制器下的文件首字母必须大写，否则报错</p><p>3、model模型文件名首字母必须大写</p><p>4、view视图所有文件名字母小写</p><p>5、class 类名首字母大写</p>'),
(18, 1, 'openant手动安装之后怎么登陆？', '<p>1、首先到官方git仓库下载最新提交的修改版本到本地</p><p>2、按照<a href="http://www.openant.com/bbs.php/community/posting.html?posting_id=16" target="_blank">教程手动安装http://www.openant.com/bbs.php/community/posting.html?posting_id=16</a></p><p>3、到数据库长到user表，把用户名为demo的记录，对应的user_group_id 改成1，demo 就成了超级管理员</p><p>登陆帐号：demo@demo.com</p><p>密码：demo123456</p>'),
(19, 1, 'openant 封装微信sdk的用法示例，以获取微信公众号菜单为例说明', '<p>1.到git仓库下载wechat sdk代码包</p><p>2.解压文件，把wechat文件夹复制到你的项目的libraries目录下</p><p>3.打开wechat/lib/Wechat_basic.php文件，找到235行如下代码，新建一张表来保存wechat的access_token，当然这不是必须的，你也可以把它的三个设置cache的方法改成存储在临时文件中（需要你自行修改）</p><pre>setting表结构\r\n     * \r\n     * -- ----------------------------\r\n --  Table structure for `setting`\r\n -- ----------------------------\r\n DROP TABLE IF EXISTS `setting`;\r\n CREATE TABLE `setting` (\r\n   `setting_id` int(11) NOT NULL AUTO_INCREMENT,\r\n   `store_id` int(11) NOT NULL DEFAULT ''0'',\r\n   `code` varchar(32) NOT NULL,\r\n   `key` varchar(64) NOT NULL,\r\n   `value` text NOT NULL,\r\n   `serialized` tinyint(1) NOT NULL,\r\n   PRIMARY KEY (`setting_id`)\r\n ) ENGINE=MyISAM AUTO_INCREMENT=95 DEFAULT CHARSET=utf8;</pre><p>4.在控制器新建一个php文件，这里我是把它放在了openant项目admin下的全局插件中，</p><p>./admin\\controllers\\extension_config\\overall/wechat_menu.php</p><pre>&lt;?php\r\ndefined(''BASEPATH'') OR exit(''No direct script access allowed'');\r\n\r\nclass Wechat_menu extends MY_Controller {\r\n \r\npublic function __construct() {\r\n  parent::__construct();\r\n  # 配置参数\r\n  $config = array(\r\n  ''token''          => $this->config->get_config(''encodingaeskey'', ''wechat'', ''0''),\r\n  ''appid''          => $this->config->get_config(''appID'', ''wechat'', ''0''),\r\n  ''appsecret''      => $this->config->get_config(''appsecret'', ''wechat'', ''0''),\r\n  ''encodingaeskey'' => $this->config->get_config(''encodingaeskey'', ''wechat'', ''0'')\r\n  );\r\n  \r\n  # 加载对应操作接口\r\n  //文件夹名注意大写\r\n  $this->load->library(''Wechat/wechat_menu'', $config);\r\n  \r\n  \r\n  $this->load->language(''wecome'');\r\n  if(!$this->user->hasPermission(''access'', ''admin/extension_config/overall/wechat_menu'')){\r\n   $this->session->set_flashdata(''fali'', ''你没有访问权限！'');\r\n   redirect(site_url());\r\n   exit;\r\n  }\r\n }\r\n\r\n public function index()\r\n {\r\n  $this->document->setTitle(''微信公众号菜单设置'');\r\n  \r\n  if($_SERVER[''REQUEST_METHOD'']=="POST" && $this->check_modify()){\r\n   \r\n   $menus=array();\r\n   foreach($this->input->post()[''menu''][''button''] as $key=>$value){\r\n    \r\n   }\r\n   var_dump($this->input->post()[''menu'']);\r\n   //redirect(site_url(''common/extension/overall''));\r\n   exit;\r\n  }\r\n  \r\n  $data[''action'']=array(\r\n    ''click''      =>''点击事件'',\r\n    ''view''      =>''跳转URL'',\r\n    ''scancode_push''    =>''扫码推事件'',\r\n    ''scancode_waitmsg''   =>''扫码推事件且弹出“消息接收中”提示框'',\r\n    ''pic_sysphoto''    =>''弹出系统拍照发图'',\r\n    ''pic_photo_or_album''  =>''弹出拍照或者相册发图'',\r\n    ''pic_weixin''    =>''弹出微信相册发图器'',\r\n    ''location_select''   =>''弹出地理位置选择器'',\r\n    ''media_id''     =>''下发消息'',\r\n    ''view_limited''    =>''跳转图文消息URL''\r\n  );\r\n  \r\n  $data[''menus''] = $this->wechat_menu->getMenu();\r\n  \r\n  $data[''header'']=$this->header->index();\r\n  $data[''top'']=$this->header->top();\r\n  $data[''footer'']=$this->footer->index();\r\n  \r\n  $this->load->view(''theme/default/template/extension_config/overall/wechat_menu'',$data);\r\n }\r\n \r\n public function check_modify(){\r\n  if (!$this->user->hasPermission(''modify'', ''admin/extension_config/overall/wechat_menu'')) {\r\n   $this->session->set_flashdata(''danger'', ''你无权修改，请联系管理员！'');\r\n   redirect(site_url(''common/extension/overall''));\r\n   exit();\r\n  }else {\r\n   return true;\r\n  }\r\n }\r\n}\r\n</pre><div>5.新建一个视图文件</div><div>./admin\\views\\theme\\default\\template\\extension_config\\overall/wecaht_menu.php</div><div><br></div><pre>&lt;?php echo $header;//装载header?&gt;\r\n&lt;?php echo $top;//装载top?&gt;\r\n<div class="container">\r\n <div class="row">\r\n  <div class="col-md-12 middle-flat-left">\r\n   <div class="panel panel-default">\r\n    <div class="panel-heading row row-panel-heading bg-info">\r\n     <p class="navbar-left"><i class="glyphicon glyphicon-signal"></i>管理微信公众号菜单</p>\r\n     <div class="navbar-right btn-group" xss=removed>\r\n      &lt;button type="button" onclick="submit(''form-module'')" class="btn btn-sm btn-default"&gt;<i class="glyphicon glyphicon-floppy-save"></i>&lt;/button&gt;\r\n      <a href="&lt;?php echo site_url(''extension_config/module/product'');?&gt;" class="btn btn-sm btn-default"><i class="glyphicon glyphicon-share-alt"></i></a>\r\n     </div>\r\n    </div>\r\n    &lt;!-- /widget-header --&gt;\r\n    <div class="panel-body">\r\n     &lt;form action="&lt;?php echo $this->config->item(''admin'');?&gt;/extension_config/overall/wechat_menu" method="post" enctype="multipart/form-data" id="form-module" class="form-horizontal"&gt;\r\n      <table class="table table-bordered">\r\n       <thead>\r\n        <tr>\r\n         <td>一级菜单</td>\r\n         <td>二级菜单</td>\r\n         <td>事件</td>\r\n         <td>关键词/链接</td>\r\n         <td>操作</td>\r\n        </tr>\r\n       </thead>\r\n       <tbody>\r\n        &lt;?php $row_top=''0'';?&gt;\r\n        &lt;?php if(!empty($menus)):?&gt;\r\n        &lt;?php foreach($menus[''menu''][''button''] as $key=>$value):?&gt;\r\n        &lt;?php if(isset($value[''sub_button'']) && !empty($value[''sub_button''])):?&gt;\r\n        <tr xss=removed id="menu-top-&lt;?php echo $row_top;?&gt;" class="menu-top">\r\n         <td colspan="2">&lt;input type="text" onblur="change_topname(''&lt;?php echo $row_top;?&gt;'');" class="form-control" id="menu-button-&lt;?php echo $row_top;?&gt;-name" name="menu[button][&lt;?php echo $row_top;?&gt;][name]" placeholder="一级菜单名" value="&lt;?php echo $value[''name''];?&gt;"&gt;</td>\r\n         <td>&lt;?php //echo $value[''type''];?&gt;\r\n          &lt;select class="form-control" id="menu-button-&lt;?php echo $row_top;?&gt;-type" name="menu[button][&lt;?php echo $row_top;?&gt;][type]" onchange="change_top_key(''&lt;?php echo $row_top;?&gt;'');"&gt;\r\n           <option value="">无事件的一级菜单</option>\r\n           &lt;?php foreach ($action as $k=>$v):?&gt;\r\n           &lt;?php if($value[''type''] == $k):?&gt;\r\n           <option value="&lt;?php echo $k;?&gt;">&lt