)):?&gt;\r\n         <td>&lt;input type="text" class="form-control" id="menu-button-&lt;?php echo $row_top;?&gt;-key-url" name="menu[button][&lt;?php echo $row_top;?&gt;][url]" placeholder="链接" value="&lt;?php echo $value[''url''];?&gt;"&gt;</td>\r\n         &lt;?php else:?&gt;\r\n         <td>&lt;input type="text" class="form-control" id="menu-button-&lt;?php echo $row_top;?&gt;-key-url" name="menu[button][&lt;?php echo $row_top;?&gt;][key]" placeholder="关键词/链接" value=""&gt;</td>\r\n         &lt;?php endif;?&gt;\r\n         \r\n         <td class="text-right">\r\n          <div class="btn-group">\r\n            &lt;button type="button" class="btn btn-info btn-sm" onclick="add_child(''&lt;?php echo $row_top?&gt;'');"&gt;添加子菜单&lt;/button&gt;\r\n            &lt;button type="button" class="btn btn-danger btn-sm" onclick="$(''#menu-top-&lt;?php echo $row_top?&gt;'').remove();$(''.menu-top-&lt;?php echo $row_top?&gt;'').remove();"&gt;删除&lt;/button&gt;\r\n          </div>\r\n         </td>\r\n         \r\n        </tr>\r\n        &lt;?php endif;?&gt;\r\n        &lt;?php $row_top++;?&gt;\r\n        &lt;?php endforeach;?&gt;\r\n        &lt;?php endif;?&gt;\r\n       </tbody>\r\n       <tfoot>\r\n        <tr>\r\n         <td colspan="5" class="text-right">&lt;button type="button" class="btn btn-info btn-sm" onclick="add_top();"&gt;添加一级菜单&lt;/button&gt;</td>\r\n        </tr>\r\n       </tfoot>\r\n      </table>\r\n     &lt;/form&gt;\r\n     &lt;!-- /area-chart --&gt; \r\n    </div>\r\n    &lt;!-- /widget-content --&gt; \r\n   </div>\r\n   &lt;!-- /widget --&gt;\r\n  </div>\r\n  &lt;!-- /span6 --&gt; \r\n </div>\r\n &lt;!-- /row --&gt; \r\n [removed]\r\n  var row_child = &lt;?php echo $row_child + 1; ?&gt;;\r\n  function add_child(row_top){\r\n   if($(''.menu-top-''+row_top).length > 4){\r\n    alert&#40;''最多添加5个子菜单''&#41;;\r\n   }else{\r\n    add_child_html(row_top, row_child);\r\n   }\r\n   check_top(row_top);\r\n   row_child++;\r\n  }\r\n\r\n  function check_top(row_top){\r\n   if($(''tbody tr'').hasClass(''menu-top-'' + row_top)){\r\n    $(''tbody tr #menu-button-'' + row_top + ''-type'').attr("disabled", "disabled");\r\n    $(''tbody tr #menu-button-'' + row_top + ''-key-url'').attr("disabled", "disabled");\r\n   }else{\r\n    $(''tbody tr #menu-button-'' + row_top + ''-type'').removeAttr("disabled");\r\n    $(''tbody tr #menu-button-'' + row_top + ''-key-url'').removeAttr("disabled");\r\n   }\r\n  }\r\n\r\n  function add_child_html(row_top, row_child){\r\n   html  = ''<tr id="menu-top-'' + row_top + row_child + ''" class="menu-top-'' + row_top + ''">'';\r\n   html += ''<td>&lt;input type="text" class="form-control menu-button-'' + row_top + ''-name" placeholder="一级菜单名" value="" disabled="disabled"&gt;</td>'';\r\n   html += ''<td>&lt;input type="text" class="form-control" id="menu-button-'' + row_top + ''-sub_button-'' + row_child + ''-name" name="menu[button]['' + row_top + ''][sub_button]['' + row_child + ''][name]" placeholder="二级菜单名" value=""&gt;</td>'';\r\n   html += ''<td>'';\r\n   html += ''&lt;select class="form-control" id="menu-button-'' + row_top + ''-sub_button-'' + row_child + ''-type" name="menu[button]['' + row_top + ''][sub_button]['' + row_child + ''][type]" onchange="change_child_key(\\\\'''' + row_top + '', \\\\'''' + row_child + ''\\\\'');"&gt;'';\r\n   html += ''<option value="">无事件的一级菜单</option>'';\r\n     &lt;?php foreach ($action as $ke=>$va):?&gt;\r\n   html += ''<option value="&lt;?php echo $ke;?&gt;">&lt;?php echo $va;?&gt;</option>'';\r\n     &lt;?php endforeach;?&gt;\r\n   html += ''&lt;/select&gt;'';\r\n   html += ''</td>'';\r\n   html += ''<td>&lt;input type="text" class="form-control" id="menu-button-'' + row_top + ''-sub_button-'' + row_child + ''-key-url" name="menu[button]['' + row_top + ''][sub_button]['' + row_child + ''][key]" placeholder="关键词/链接" value=""&gt;</td>'';\r\n    \r\n   html += ''<td class="text-right">&lt;button type="button" class="btn btn-danger btn-sm" onclick="$(\\\\''#menu-top-'' + row_top + row_child + ''\\\\'').remove();check_top('' + row_top + '');"&gt;删除&lt;/button&gt;</td>'';\r\n   html += ''</tr>'';\r\n\r\n   if($(''tbody tr'').hasClass(''menu-top-'' + row_top)){\r\n    $(''.menu-top-'' + row_top +'':last'').after(html);\r\n   }else{\r\n    $(''#menu-top-'' + row_top).after(html);\r\n   }\r\n\r\n   $(''.menu-button-'' + row_top + ''-name'').val($(''#menu-button-'' + row_top + ''-name'').val());\r\n  }\r\n\r\n  var row_top = &lt;?php echo $row_top + 1;?&gt;;\r\n  function add_top(){\r\n   if($(''tbody .menu-top'').length > 2){\r\n    alert&#40;''最多添加3个一级菜单''&#41;;\r\n   }else{\r\n    add_top_html(row_top);\r\n   }\r\n   row_top++;\r\n  }\r\n\r\n  function add_top_html(row_top){\r\n   html  = ''<tr xss=removed id="menu-top-'' + row_top + ''" class="menu-top">'';\r\n   html += ''<td colspan="2">&lt;input type="text" onblur="change_topname(\\\\'''' + row_top + ''\\\\'');" class="form-control" id="menu-button-'' + row_top + ''-name" name="menu[button]['' + row_top + ''][name]" placeholder="一级菜单名" value=""&gt;</td>'';\r\n   html += ''<td>'';\r\n   html += ''&lt;select class="form-control" id="menu-button-'' + row_top + ''-type" name="menu[button]['' + row_top + ''][type]" onchange="change_top_key(\\\\'''' + row_top + ''\\\\'');"&gt;'';\r\n   html += ''<option value="">无事件的一级菜单</option>'';\r\n     &lt;?php foreach ($action as $k=>$v):?&gt;\r\n   html += ''<option value="&lt;?php echo $k;?&gt;">&lt;?php echo $v;?&gt;</option>'';\r\n     &lt;?php endforeach;?&gt;\r\n   html += ''&lt;/select&gt;'';\r\n   html += ''</td>'';\r\n   html += ''<td>&lt;input type="text" class="form-control" id="menu-button-'' + row_top + ''-key-url" name="menu[button]['' + row_top + ''][key]" placeholder="关键词/链接" value=""&gt;</td>'';\r\n   html += ''<td class="text-right">'';\r\n   html += ''<div class="btn-group">'';\r\n   html += ''&lt;button type="button" class="btn btn-info btn-sm" onclick="add_child(\\\\'''' + row_top + ''\\\\'');"&gt;添加子菜单&lt;/button&gt;'';\r\n   html += ''&lt;button type="button" class="btn btn-danger btn-sm" onclick="$(\\\\''#menu-top-'' + row_top + ''\\\\'').remove();$(\\\\''.menu-top-'' + row_top + ''\\\\'').remove();"&gt;删除&lt;/button&gt;'';\r\n   html += ''</div>'';\r\n   html += ''</td>'';\r\n   html += ''</tr>'';\r\n\r\n   if($(''tbody tr'').hasClass(''menu-top'')){\r\n    $(''tbody tr:last'').after(html);\r\n   }else{\r\n    $(''tbody'').append(html);\r\n   }\r\n  }\r\n\r\n  function change_topname(row_top){\r\n   $(''.menu-button-'' + row_top + ''-name'').val($(''#menu-button-'' + row_top + ''-name'').val());\r\n  }\r\n\r\n  function change_top_key(row_top){\r\n   if($(''#menu-button-'' + row_top + ''-type'').val() == ''view''){\r\n    $(''#menu-button-'' + row_top + ''-key-url'').attr("name", "menu[button][" + row_top + "][url]");\r\n   }else{\r\n    $(''#menu-button-'' + row_top + ''-key-url'').attr("name", "menu[button][" + row_top + "][key]");\r\n   }\r\n  }\r\n\r\n  function change_child_key(row_top, row_child){\r\n   if($(''#menu-button-'' + row_top + ''-sub_button-'' + row_child + ''-type'').val() == ''view''){\r\n    $(''#menu-button-'' + row_top + ''-sub_button-'' + row_child + ''-key-url'').attr("name", "menu[button][" + row_top + "][sub_button][" + row_child + "][url]");\r\n   }else{\r\n    $(''#menu-button-'' + row_top + ''-sub_button-'' + row_child + ''-key-url'').attr("name", "menu[button][" + row_top + "][sub_button][" + row_child + "][key]");\r\n   }\r\n  }\r\n [removed]\r\n</div>\r\n&lt;!-- /container --&gt;\r\n&lt;?php echo $footer;//装载header?&gt;</pre><p>这就是全部，但是值得申明的是，这只是我在项目中使用的实例，wechat sdk类库封装可能适合你，但是上面这两段代码对你豪无用处，除非你使用的是openant, 否则你需要按你项目来设计业务逻辑</p>'),
(20, 1, '社区新增帖子访问量统计功能、关注帖子功能', '<p>新增功能，在帖子标题右侧可以关注帖子，关注的帖子会在你的社区个人中心列出来，同时帖子下方也会展示关注者列表，这个功能的页面装载采用了ajax.load</p>'),
(21, 1, '安装好openant后怎么进后台？', '<p>安装好之后你需要进入数据库找到 user表把demo 用户的user_group_class改为1就有超级管理员权限了，</p><p>登陆帐号：demo@demo.com</p><p>密码：123456</p>'),
(22, 1, 'crontab 每分钟/每小时、每天、每周、每月、每年定时执行 ', '<p xss="removed"><span xss="removed">每五分钟执行              */5 * * * *</span></p><p xss="removed"><span xss="removed">每小时执行               0 * * * *</span></p><p xss="removed"><span xss="removed">每天执行                 0 0 * * *</span></p><p xss="removed"><span xss="removed">每周执行                 0 0 * * 0</span></p><p xss="removed"><span xss="removed">每月执行                 0 0 1 * *</span></p><p xss="removed"><span xss="removed">每年执行                 0 0 1 1 *</span></p>'),
(23, 1, '2017，3月版本，安装更加简单，教程来这里看', '<p>这个版本简化了所有的配置，配置文件都在 public/config/ 文件夹下了</p><p>config.php 主要是路径的配置，按你实际的路径填就行了。</p><p>数据库配置在database.php文件夹下。</p><p>如果有报错，请发帖请助，我正准备把项目向社区转移。直接来问的不会及时处理了 谢谢配合</p>'),
(24, 1, '有些界面在手机界面模式下会  404', '<div xss=removed><div>如购物车，发帖等，手机模式下界面也不够完善和和谐。<br></div></div>'),
(25, 1, '一些页面错误', '<ul><li>顶部未读消息会遮挡部分用户名。<br></li><li>发帖内容不够长点发布，这时候什么都没了...</li><li>没头像的情况下显示也有问题。</li><li>用户名达到一定长度未读消息会部分覆盖用户名。<br></li></ul>'),
(26, 1, '订单提交严重问题', '<p>订单界面地址信息为空或者部分信息为空</p><p>提交订单，报错。</p><p>应该做相应的提示信息。</p><p><br></p><p>。<br></p>'),
(27, 1, '111111', '<p>1111</p>'),
(28, 1, '没有访问权限，登陆不了，提示Access denied. ', '<p>没有访问权限，登陆不了，提示Access denied. <br></p>'),
(29, 1, '部署完成，访问有错', '<p><span xss=removed>Parse error: syntax error, unexpected ''['' in </span></p><p><span xss=removed>/catalog/controllers/Wecome.php on line 12</span></p><div xss=removed><h4>A PHP Error was encountered</h4><p>Severity: Parsing Error</p><p>Message: syntax error, unexpected ''[''</p><p>Filename: controllers/Wecome.php</p><p>Line Number: 12</p><p>Backtrace:</p></div>'),
(30, 1, '貌似php7.1以后的版本使用redis存储session 有问题', '<p>本站用的是php7.0.23</p><p>apache版本是2.4</p><p>mysql 版本是5.6</p>'),
(31, 1, '配置后 无法登陆和注册', '<p>使用最新版本的xampp配置后 可以正常打开网站但是主页显示不正常， 无法登陆和注册时不能显示验证码，左侧是空白的 ，只有论坛是正常的，不知道什么原因</p><p>$config[''base_url''] = ''http://localhost/'';//主域名</p><p>//入口文件</p><p>$config[''catalog''] = ''http://localhost/index.php/'';//前台入口或二级域名</p><p>$config[''sale''] = ''http://localhost/sale/index.php/'';//商家入口或二级域名<br></p><p>$config[''bbs''] = ''http://localhost/bbs/index.php/'';//论坛入口或二级域名<br></p><p>$config[''admin''] = ''http://localhost/admin/index.php'';//后台入口或二级域名<br></p><img cyii=" data-filename=" xss="removed"><img data-filename="image.png" xss=removed>'),
(32, 1, 'Mac下搭建php开发环境教程', '<p xss=removed>Mac OS X 内置了Apache 和 PHP，这样使用起来非常方便。本文以Mac OS X 10.6.3为例。主要内容包括：</p><p xss=removed>启动Apache<br>运行PHP<br>安装MySQL<br>使用phpMyAdmin<br>配置PHP的MCrypt扩展库<br>设置虚拟主机</p><p xss=removed><strong>启动Apache</strong></p><p xss=removed>有两种方法：</p><p xss=removed>打开“系统设置偏好（System Preferences）” -> “共享（Sharing）” -> “Web共享（Web Sharing）”<br>打开“终端（terminal）”，然后（注意：sudo需要的密码就是系统的root帐号密码）<br>运行“sudo apachectl start”，再输入帐号密码，这样Apache就运行了。</p><p xss=removed>运行“sudo apachectl －v”，你会看到Mac OS X 10.6.3中的Apache版本号：</p><p xss=removed>Server version: Apache/2.2.14 (Unix)<br>Server built:   Feb 11 2010 14:40:31</p><p xss=removed>这样在浏览器中输入“http://localhost”，就可以看到出现一个内容为“It works!”的页面，它位于“/Library（资源库）/WebServer/Documents/”下，这是Apache的默认根目录。</p><p xss=removed>注意：开启了Apache就是开启了“Web共享”，这时联网的用户就会通过“http://[本地IP]/”来访问“/Library（资源库）/WebServer/Documents/”目录，通过“http://[本地IP]/~[用户名]”来访问“/Users/[用户名]/Sites/”目录，可以通过设置“系统偏好设置”的“安全（Security）”中的“防火墙（Firewall）”来禁止这种访问。</p><p xss=removed><strong>运行PHP</strong></p><p xss=removed>在终端中运行“sudo vi /etc/apache2/httpd.conf”，打开Apache的配置文件。（如果不习惯操作终端和vi的可以设置在Finder中显示所有的系统隐藏文件，记得需要重启Finder，这样就可以找到对应文件，随心所欲编辑了，但需要注意的是某些文件的修改需要开启root帐号，但整体上还是在终端上使用sudo来临时获取root权限比较安全。）</p><p xss=removed>找到“#LoadModule php5_module libexec/apache2/libphp5.so”，把前面的#号去掉，保存（在命令行输入:w）并退出vi（在命令行输入:q）。</p><p xss=removed>运行“sudo cp /etc/php.ini.default /etc/php.ini”，这样就可以通过php.ini来配置各种PHP功能了。比如：</p><p xss=removed>;通过下面两项来调整PHP提交文件的最大值，比如phpMyAdmin中导入数据的最大值</p><p xss=removed>upload_max_filesize = 2M<br>post_max_size = 8M</p><p xss=removed>;比如通过display_errors来控制是否显示PHP程序的报错</p><p xss=removed>display_errors = Off</p><p xss=removed>运行“sudo apachectl restart”，重启Apache，这样PHP就可以用了。</p><p xss=removed>运行“cp /Library/WebServer/Documents/index.html.en /Library/WebServer/Documents/info.php”，即在Apache的根目录下复制index.html.en文件并重命名为info.php</p><p xss=removed>在终端中运行“vi /Library/WebServer/Document/info.php”，这样就可以在vi中编辑info.php文件了。在“It''s works!”后面加上“&lt;?php phpinfo(); ?&gt;”，然后保存之。这样就可以在http://localhost/info.php中看到有关PHP的信息，比如版本号是5.3.1。</p><p xss=removed><strong>安装MySQL</strong></p><p xss=removed>由于Mac OS X中并没有预装MySQL，所以需要自己手动安装，目前MySQL的最稳定版本是5.1。MySQL提供了Mac OS X下的安装说明。<br>下载MySQL 5.1。选择合适的版本，比如这里选择的是mysql-5.1.46-osx10.6-x86_64.dmg。<br>运行dmg，会发现里面有4个文件。首先点击安装mysql-5.1.46-osx10.6-x86_64.pkg，这是MySQL的主安装包。一般情况下，安装文件会自动把MySQL安装到/usr/local下的同名文件夹下。比如点击运行“mysql-5.1.46-osx10.6-x86_64.dmg”会把MySQ安装到“/usr/local/mysql-5.1.46-osx10.6-x86_64”中。一路默认安装完毕即可。</p><p xss=removed>点击安装第2个文件MySQLStartupItem.pkg，这样MySQL就会自动在开机时自动启动了。</p><p xss=removed>点击安装第3个文件MySQL.prefPane，这样就会在“系统设置偏好”中看到名为“MySQL”的ICON，通过它就可以设置MySQL开始还是停止，以及是否开机时自动运行。到这里MySQL就基本安装完毕了。</p><p xss=removed>通过运行“sudo vi /etc/bashrc”，在bash的配置文件中加入mysql和mysqladmin的别名</p><p xss=removed></p><div class="codetitle" xss=removed><span xss=removed><a data="8951" class="copybut" id="copybut8951" xss=removed><u>复制代码</u></a></span>代码如下:</div><div class="codebody" id="code8951" xss=removed><br>#mysql<br>alias mysql=''/usr/local/mysql/bin/mysql''<br>alias mysqladmin=''/usr/local/mysql/bin/mysqladmin''<br></div><p xss=removed></p><p xss=removed>这样就可以在终端中比较简单地通过命令进行相应的操作，比如安装完毕之后MySQL的root默认密码为空，如果要设置密码可以在终端运行“mysqladmin -u root password "mysqlpassword"”来设置，其中mysqlpassword即root的密码。更多相关内容可以参考B.5.4.1. How to Reset the Root Password。</p><p xss=removed>注意：Mac OS X的升级或者其他原因可能会导致ＭySQL启动或者开机自动运行，在ＭySQL的操作面板上会提示“Warning:The /usr/local/mysql/data directory is not owned by the ''mysql'' or ''_mysql'' ”，或者在命令行下提示“Can''t connect to local MySQL server through socket ''/tmp/mysql.sock'' (2)”，这应该是某种情况下导致/usr/local/mysql/data的宿主发生了改变，只需要运行“sudo chown -R mysql /usr/local/mysql/data”即可。</p><p xss=removed>另外，使用PHP连接MySQL可能会报错“Can''t connect to local MySQL server through socket ‘/var/mysql/mysql.sock''”，或者使用localhost无法连接MySQL而需要127.0.0.1，原因是连接时候php默认去找/var/mysql/mysql.sock了，但是MAC版本的MYSQL改动了文件的位置，放在/tmp下了。处理办法是按如下修改php.ini：</p><p xss=removed>mysql.default_socket = /tmp/mysql.sock</p><p xss=removed><strong>使用phpMyAdmin</strong></p><p xss=removed>phpMyAdmin是用PHP开发的管理MySQL的程序，非常的流行和实用。能够实用phpMyAdmin管理MySQL是检验前面几步成果的非常有效方式。</p><p xss=removed>下载phpMyAdmin。选择合适的版本，比如我选择的是phpMyAdmin-3.3.2-all-languages.tar.bz2这个版本。</p><p xss=removed>把“下载（downloads）”中的phpMyAdmin-3.32-all-languages文件夹复制到“/Users/[用户名]/Sites”中，名改名为phpmyadmin。</p><p xss=removed>复制“/Users/[用户名]/Sites/phpmyadmin/”中的config.sample.inc.php，并命名为config.inc.php</p><p xss=removed>打开config.inc.php,做如下修改：</p><p xss=removed>用于Cookie加密，随意的长字符串</p><p xss=removed>$cfg[''blowfish_secret''] = ''''; </p><p xss=removed>当phpMyAdmin中出现“#2002 无法登录 MySQL 服务器”时，</p><p xss=removed>请把localhost改成127.0.0.1就ok了，</p><p xss=removed>这是因为MySQL守护程序做了IP绑定（bind-address =127.0.0.1）造成的</p><p xss=removed>$cfg[''Servers''][$i][''host''] = ''localhost'';</p><p xss=removed>把false改成true，这样就可以访问无密码的MySQL了，</p><p xss=removed>即使MySQL设置了密码也可以这样设置，然后在登录phpMyAdmin时输入密码</p><p xss=removed>$cfg[''Servers''][$i][''AllowNoPassword''] = false;</p><p xss=removed>这样就可以通过http://localhost/~[用户名]/phpmyadmin访问phpMyAdmin了。这个时候就看到一个提示“无法加载 mcrypt 扩展，请检查您的 PHP 配置。”，这就涉及到下一节安装MCrypt扩展了。</p><p xss=removed><strong>配置PHP的MCrypt扩展</strong></p><p xss=removed>MCrypt是一个功能强大的加密算法扩展库，它包括有22种算法，phpMyAdmin依赖这个PHP扩展库。但是它在Mac OS X下的安装却不那么友善，具体如下：</p><p xss=removed>下载并解压libmcrypt-2.5.8.tar.bz2。</p><p xss=removed>在终端执行如下命令（注意如下命令需要安装xcode支持）：</p><p xss=removed></p><div class="codetitle" xss=removed><span xss=removed><a data="666" class="copybut" id="copybut666" xss=removed><u>复制代码</u></a></span>代码如下:</div><div class="codebody" id="code666" xss=removed><br>cd ~/Downloads/libmcrypt-2.5.8/<br>./configure --disable-posix-threads --enable-static<br>make<br>sudo make install<br></div><p xss=removed></p><p xss=removed>下载并解压PHP源码文件php-5.3.1.tar.bz2。Mac OS X 10.6.3中预装的PHP版本是5.3.1，而现在最新的PHP版本是5.3.2，你需要依据自己的实际情况选择对应的版本。</p><p xss=removed><strong>在终端执行如下命令：</strong></p><p xss=removed></p><div class="codetitle" xss=removed><span xss=removed><a data="78639" class="copybut" id="copybut78639" xss=removed><u>复制代码</u></a></span>代码如下:</div><div class="codebody" id="code78639" xss=removed><br>cd ~/Downloads/php-5.3.1/ext/mcrypt<br>phpize<br>./configure<br>make<br>cd modules<br>sudo cp mcrypt.so /usr/lib/php/extensions/no-debug-non-zts-20090626/<br></div><p xss=removed></p><p xss=removed>打开php.ini</p><p xss=removed>sudo vi /etc/php.ini</p><p xss=removed>在php.ini中加入如下代码，并保存后退出，然后重启Apache</p><p xss=removed>extension=/usr/lib/php/extensions/no-debug-non-zts-20090626/mcrypt.so</p><p xss=removed>当你再访问http://localhost/~[用户名]/phpmyadmin时，你会发现“无法加载 mcrypt 扩展，请检查您的 PHP 配置。”的提示没有了，这就表示MCrypt扩展库安装成功了。</p><p xss=removed><strong>设置虚拟主机</strong> </p><p xss=removed>在终端运行“sudo vi /etc/apache2/httpd.conf”，打开Apche的配置文件</p><p xss=removed>在httpd.conf中找到“#Include /private/etc/apache2/extra/httpd-vhosts.conf”，去掉前面的“＃”，保存并退出。</p><p xss=removed>运行“sudo apachectl restart”，重启Apache后就开启了它的虚拟主机配置功能。</p><p xss=removed>运行“sudo vi /etc/apache2/extra/httpd-vhosts.conf”，这样就打开了配置虚拟主机的文件httpd-vhost.conf，配置你需要的虚拟主机了。需要注意的是该文件默认开启了两个作为例子的虚拟主机：</p><p xss=removed></p><div class="codetitle" xss=removed><span xss=removed><a data="18160" class="copybut" id="copybut18160" xss=removed><u>复制代码</u></a></span>代码如下:</div><div class="codebody" id="code18160" xss=removed><br><VirtualHost><br>    ServerAdmin webmaster@dummy-host.example.com<br>    DocumentRoot "/usr/docs/dummy-host.example.com"<br>    ServerName dummy-host.example.com<br>    ErrorLog "/private/var/log/apache2/dummy-host.example.com-error_log"<br>    CustomLog "/private/var/log/apache2/dummy-host.example.com-access_log" common<br></VirtualHost><br><VirtualHost><br>    ServerAdmin webmaster@dummy-host2.example.com<br>    DocumentRoot "/usr/docs/dummy-host2.example.com"<br>    ServerName dummy-host2.example.com<br>    ErrorLog "/private/var/log/apache2/dummy-host2.example.com-error_log"<br>    CustomLog "/private/var/log/apache2/dummy-host2.example.com-access_log" common<br></VirtualHost> <br></div><p xss=removed></p><p xss=removed>而实际上，这两个虚拟主机是不存在的，在没有配置任何其他虚拟主机时，可能会导致访问localhost时出现如下提示：</p><p xss=removed>Forbidden</p><p xss=removed>You don''t have permission to access /index.php on this server</p><p xss=removed>最简单的办法就是在它们每行前面加上#，注释掉就好了，这样既能参考又不导致其他问题。</p><p xss=removed>增加如下配置</p><p xss=removed></p><div class="codetitle" xss=removed><span xss=removed><a data="99597" class="copybut" id="copybut99597" xss=removed><u>复制代码</u></a></span>代码如下:</div><div class="codebody" id="code99597" xss=removed><br><VirtualHost><br>    DocumentRoot "/Users/[用户名]/Sites"<br>    ServerName sites<br>    ErrorLog "/private/var/log/apache2/sites-error_log"<br>    CustomLog "/private/var/log/apache2/sites-access_log" common<br></VirtualHost> <br></div><p xss=removed></p><p xss=removed>保存退出，并重启Apache。</p><p xss=removed>运行“sudo vi /etc/hosts”，打开hosts配置文件，加入”127.0.0.1 sites“，这样就可以配置完成sites虚拟主机了，这样就可以用“http://sites”访问了，其内容和“http://localhost/~[用户名]”完全一致。</p><p xss=removed>这是利用Mac OS X 10.6.3中原生支持的方式来实现的配置，也可以参考“Mac OS X Leopard: 配置Apache, PHP, SQLite, MySQL, and phpMyAdmin(一) ”和“Mac OS X Leopard: 配置Apache, PHP, SQLite, MySQL, and phpMyAdmin(二) ”。实际上，你还可以使用XAMPP或MacPorts这种第三方提供的集成方案来实现简单的安装和使用。</p>'),
(33, 1, 'sudo apt-get update无法获得锁，无法对目录加锁', '<p xss=removed><span xss=removed><strong>问题：</strong></span></p><p xss=removed><span xss=removed>        更新资源sudo apt-get update时遇到</span></p><p xss=removed><span xss=removed><span xss=removed></span>        E: 无法获得锁 /var/lib/apt/lists/lock - open (11: 资源暂时不可用)</span></p><p xss=removed><span xss=removed>        E: 无法对目录 /var/lib/apt/lists/ 加锁</span></p><p xss=removed><span xss=removed><strong>解决办法：</strong></span></p><p xss=removed><span xss=removed>     （1）sudo rm /var/lib/apt/lists/lock</span></p><p xss=removed><span xss=removed>     （2） ps aux      #列出当前进程列表 找到 apt-get 那个被lock住的进程记下PID</span></p><p xss=removed><span xss=removed><span xss=removed></span>               sudo kill PID 即可</span></p>'),
(34, 1, 'ubuntu下用命令行安装deb软件包', '<p>如果ubuntu要安装新软件，已有deb安装包（例如：iptux.deb），但是无法登录到桌面环境。那该怎么安装？答案是：使用dpkg命令。<br xss=removed>dpkg命令常用格式如下：<br xss=removed><span xss=removed>sudo dpkg -I iptux.deb</span><span xss=removed>#查看iptux.deb软件包的详细信息，包括软件名称、版本以及大小等（其中-I等价于--info）</span><br xss=removed><span xss=removed>sudo dpkg -c iptux.deb</span><span xss=removed>#查看iptux.deb软件包中包含的文件结构（其中-c等价于--contents）</span><br xss=removed><span xss=removed>sudo dpkg -i iptux.deb</span><span xss=removed>#安装iptux.deb软件包（其中-i等价于--install）</span><br xss=removed><span xss=removed>sudo dpkg -l iptux</span><span xss=removed>#查看iptux软件包的信息（软件名称可通过dpkg -I命令查看，其中-l等价于--list）</span><br xss=removed><span xss=removed>sudo dpkg -L iptux</span><span xss=removed>#查看iptux软件包安装的所有文件（软件名称可通过dpkg -I命令查看，其中-L等价于--listfiles）</span><br xss=removed><span xss=removed>sudo dpkg -s iptux</span><span xss=removed>#查看iptux软件包的详细信息（软件名称可通过dpkg -I命令查看，其中-s等价于--status）</span><br xss=removed><span xss=removed>sudo dpkg -r iptux</span><span xss=removed>#卸载iptux软件包（软件名称可通过dpkg -I命令查看，其中-r等价于--remove）</span><br xss=removed><span xss=removed>注：dpkg命令无法自动解决依赖关系。如果安装的deb包存在依赖包，则应避免使用此命令，或者按照依赖关系顺序安装依赖包。</span><br></p>'),
(35, 1, 'windows和linux下扫瞄局域网ip命令', '<p>这个还是经常用到的</p><p>有时候我们会想要知道另一个设备的ip地址，而又进不去路由器的时候，可以在命令行直接输入 arp -a 命令，就能列出所有内网ip和mac地址了</p><p>特别是只有一个电脑，一个树莓派的时候，找不到它ip就瞎了</p>');
