(36, 1, '<p>我认为一款产品适应国情是很重要的。</p><p>提几个不成文的小建议给站长，纯属交流哈~</p><p>1.目前微信很火，主流商城系统都整合了相关接口。</p><p>2.针对移动端做出足够的优化，例如：整合服务号后，可以微信支付等。。。</p><p>3.卖家模版装修完善（现在好像没有吧），支持移动端和PC两套（模版可后台制作上传后内置一部分，商家自有设计一部分）。</p><p>4.卖家有自己的店铺页面。</p><p>5.完善交易日志和交易记录，并且可以导出和对账等。</p><p>当然了，如果展开说，那就多了去了，而且站长也不一定全部都开发出来，很多也都可以通过插件方式加入。目前没具体看到手册和代码，所以不知道是否有很好的扩展性，近期研究研究哈~</p>'),
(37, 1, '<p>原来这个是基于opencart的呀，难怪页面和布局这么难受。国情。。国情哈~~</p>'),
