(68, 1, '家装/家饰', '<div>1.简约/外观简单别致，没有花里花哨的修饰却也有别有一番情趣，给人简洁、清爽的视觉效果。 </div><div>2.简约的设计理念，细腻、精致的做工，这不仅是产品，更是时尚魅力诱惑的艺术品，相结 合带来唯美的生活享受。</div>', '家装/家饰', '', ''),
