(8, 1, '加盟合同', '<p xss="removed"><span xss="removed">一、合同各方<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">授权方：<span lang="EN-US">______</span>科技发展有限公司（以下简称“甲方”）<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">法定授权人：<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">法定地址：上海市<span lang="EN-US">____</span>路<span lang="EN-US">____</span>大厦<span lang="EN-US">a</span>座<span lang="EN-US">12a </span>邮编：<span lang="EN-US">______<o></o></span></span></p><p xss="removed"><span xss="removed">被授权方：<span lang="EN-US">___________________________________ </span>（以下简称“乙方”）<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">法定代表人：<span lang="EN-US">_____________<o></o></span></span></p><p xss="removed"><span xss="removed">法定地址：<span lang="EN-US"> __________________________________<o></o></span></span></p><p xss="removed"><span xss="removed">甲乙双方经协商，就乙方为其在特定区域内<span lang="EN-US">__</span>经营甲方的“<span lang="EN-US">______</span>”专卖店一事，达成如下协议：<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">二、合同期限<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">本合同加盟期限为<span lang="EN-US">________</span>年<span lang="EN-US">__</span>月<span lang="EN-US">__</span>日至<span lang="EN-US">________</span>年<span lang="EN-US">__</span>月<span lang="EN-US">__</span>日止。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">三、加盟经营<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、 甲方特此授权乙方为 区域内成为“<span lang="EN-US">______</span>”的特许经销商。经此授权后，甲方在该区域内将不再授予任何其它企业、个人以同类经销权。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、 在授权期内，甲方在向乙方提供“<span lang="EN-US">______</span>”品牌产品时，甲方应保证所提供的产品质量符合国家有关标准、品级与实物相符，并保证货源供应。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、 乙方保证在签订本合同<span lang="EN-US">7</span>日内需向甲方支付加盟费人民币贰万元<span lang="EN-US">/</span>店。每个加盟店首次从甲方购进“<span lang="EN-US">______</span>”品牌的产品，按供货价不少于 万元。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、甲方保证向中国大陆内各加盟方交付的产品保持统一的零售标价。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">5</span><span xss="removed">、甲方将“<span lang="EN-US">______</span>”品牌产品按零售标价的<span lang="EN-US">4</span>—<span lang="EN-US">4.5</span>折售予乙方（详细见配货单），不论首次购货还是后续购货乙方应在提货时一次性支付货款。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">6</span><span xss="removed">、如果出现乙方采用以假汇票、假支票的方式骗取货物的情况，甲方除追究乙方的违约责任外，将依法请求司法机关追究相关人员、单位的刑事责任。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">7</span><span xss="removed">、乙方从甲方购进产品后，如因质量问题或货物品种组合问题，可在自进货之日起五天内，向甲方调换产品，但不得退货。调换时乙方须保持原产品完好、包装齐备、标签没有损坏。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">8</span><span xss="removed">、合同到期后，若乙方决定不再销售“<span lang="EN-US">______</span>”品牌产品，在乙方保证产品完好、包装齐备、标签无损坏、未超过保质期的前提下，可将现存的“<span lang="EN-US">______</span>”产品退还给甲方。甲方按供货价的<span lang="EN-US">6</span>折回收退还的产品。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">三、营业场地、店面装饰与配置<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、 乙方应在双方共同商定的区域内开展经营和促销活动。乙方不得在未经甲方许可的情况下擅自将自己的经营活动和促销活动扩大到区域之外。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、加盟店店铺设在乙方处，或由乙方自行选定其它场所并报甲方批准。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、为维护公司品牌形象的统一性，加盟店由甲方免费进行装饰设计，装修工程由甲方工程部报价并施工，乙方应按工程预算支付装修工程款并协助办理在当地施工的相关手续。甲方收到工程款项后\r\n日内将店铺交付乙方使用。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、加盟店内的营业所需（包括：设备、装置、用具、招牌等）由总部统一进行设计制作。对于营运必需的包装材料、促销礼品、提货袋及其它附属材料、消耗品，加盟店需使用总部配备的产品。\r\n上述所涉及的费用由加盟商承当。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">四、促销与广告<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、甲方在授权期内，将协助乙方进行“<span lang="EN-US">______</span>”品牌的形象设计，并向乙方适时提供相应的产品宣传资料、标识、招贴物品等。甲方可根据乙方的经营状况和要求，帮助乙方进行特定时间和区域的产品促销和推广活动。（具体事宜可另议）<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、甲方进行 “<span lang="EN-US">______</span>”品牌的整体宣传活动乙方必须配合，相关的“<span lang="EN-US">______</span>”品牌的产品进行促销、推广计划和广告设计由甲方提供，乙方遵照执行。甲方对于促销活动所涉产品在供货价基础上按照促销折让的比例给与优惠。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、乙方单独进行“<span lang="EN-US">______</span>”品牌有关的宣传、广告活动时，应事先告知甲方，取得甲方同意后方可进行。相关广告形象设计须经过甲方审核或由甲方提供。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、乙方须承担自行组织促销活动产生促销让利和费用。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">五、培训与指导<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、为使加盟店能良好经营，在开业前及本合同执行期间，甲方应向加盟店传授必要的知识和经营技术。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、加盟店在开业前应派遣店主或两名可以代行承担的职工，参加甲方规定的教育研修，获得经营公司店铺必要的知识和技术。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、开业后，如甲方有研修指示，乙方也必须按指示要求派员再次参加前项规定的进修教育，获得必需的知识和技术。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、加盟店承担前来培训的旅差费用。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">5</span><span xss="removed">、加盟店开业前后三天，作为店铺营运入轨期，甲方应向加盟店派遣人员进行开业和经营指导。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">6</span><span xss="removed">、乙方必须参加甲方组织的年度销售会议及临时经营者会议。甲方应提前四周通知开会日期。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">7</span><span xss="removed">、除经营者会议外，甲方将不定期向乙方派遣市场负责人进行指导和培训。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">六、商标、服务标志及相关权利<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、本合同所涉及的所有商标、服务标志及其相关权利的所有权均归属于甲方。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、甲方承诺在本合同执行期间，乙方加盟店可以使用甲方商标、服务标志及表示这些标志、记号、样式、标签和招牌。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、乙方不得在加盟店以外使用甲方的所有商标和服务标志。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、乙方应在经营中向顾客提供良好的服务，维护甲方品牌的声誉、信誉和良好形象。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">5</span><span xss="removed">、双方在此明确，乙方取得的是在授权期内、在指定区域内甲方商标、服务标志的使用权和产品的经销权，这并不意味着甲方商标、品牌及商誉等相关知识产权的任何转让、许可。合同到期或提前终止后，乙方不得以任何借口继续使用“<span lang="EN-US">______</span>”品牌，或以“<span lang="EN-US">______</span>”品牌经销商的名义从事任何商业活动。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">七、竞争限制<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、在合同期内，乙方如有意获得其所在省市区域的“<span lang="EN-US">______</span>”特许经营代理权，可在同等条件下优先取得甲方的特许代理权。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、为表示对甲方合作的诚意，在合同期内，如甲方推出“<span lang="EN-US">______</span>”之外的其它新系列商品和服务，乙方有优先代理权。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、乙方在授权期内，不得再接受任何其它企业、个人的授权或委托，在加盟店内代理、经销其它品牌的产品。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、乙方未经甲方许可，不得将甲方授予的经销权以各种形式转让给任何第三方。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">八、服务质量控制<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、为维护加盟店售出商品品种和服务的一致性，提高公司形象，乙方加盟店的运营方法必须遵守总部提供的经营手册规定的要求和标准。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、凡甲方有新产品推出，乙方必须按照最低配货量或以上的数量购入，并将新产品及时上架销售。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、乙方须按照甲方要求，对顾客购买金额达到规定标准时，给与“玫瑰卡”会员资格和相应的折扣优惠，做好会员资料信息的登记汇总工作并半年一次定期向甲方提供会员资料信息。凡有新产品上市或产品促销活动乙方应通知所有会员，让会员享受到来自“<span lang="EN-US">______</span>”持续不断的优质服务。甲方将不定期回访会员客户以检查乙方的服务质量。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、甲方定期和不定期地以书面或其它方式对加盟店进行进货管理、销售管理、商品管理、商品知识、卫生管理、职工管理、会计处理、店铺经营管理、店铺陈设等各方面的指导，提供有关信息，帮助加盟店实施标准化管理。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">5</span><span xss="removed">、随着甲方加盟店数量在全国范围内的不断增加，甲方将对全体加盟店进行信息化管理。如该项管理实施时本合同仍在有效期内，乙方须遵照甲方的管理规定执行，不得以如任何理由拒绝执行。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">九、保密<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、除<span lang="EN-US"><a href="http://www.chinalawedu.com/" target="_blank" title="法律" xss="removed"><span lang="EN-US"><span lang="EN-US">法律</span></span></a></span>规定必须公开的以外，甲方不得向第三者展示乙方递交的营业报告书及其它有关资料和有损于乙方利益的情报。乙方不得向第三者泄漏甲方按本合同规定提供给乙方的经营技术秘密及有损甲方利益的情报。乙方有责任保证其职工不向第三者泄漏前项秘密。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、以上规定双方的保密义务在本合同期满后仍然有效。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、甲方按本合同规定提供给乙方的加盟店经营手册以及其它文件归甲方所有，乙方应妥善保管，合同终止时，乙方应即刻归还甲方。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">十、加盟店的让渡与承继<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、乙方未事先征得甲方同意，不得将本合同规定的任何权利、加盟店营业的全部或一部分转让给第三者，不得将此用作担保和其它处置。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、如乙方加盟店因明显的困难而有可能发生营业中断时，为保持加盟连锁店的运营，乙方可以请求总部临时接替营业。待总部确认加盟店可以重新经营后，应及时把营业权归还加盟店。<span lang="EN-US">3</span>、上述总部接替经营期间发生的收益和损失均属加盟店，总部代行经营所产生的费用由加盟店负担。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、如乙方希望出让加盟店或出租店铺时，应首先通知甲方，甲方有优先承让和承租的权利。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">5</span><span xss="removed">、遇上述情况，双方可以通过协商，确定加盟店让渡价格和租赁金。协商意向不能成立时，双方均可申请具有法律效力的认证或评估，所需费用由乙方承担。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">十一、合同的终止<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、合同期满前<span lang="EN-US">3</span>个月，经双方协商，可以更新合同。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、前款的合同更新，应在本合同期满之前一个月完成。以双方签订新的特许连锁合同书为合作文本。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">3</span><span xss="removed">、如本合同期满后双方无意继续合作，乙方应在本合同终止时承担下列义务：<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">a</span><span xss="removed">、支付所有应付给总部的费用；<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">b</span><span xss="removed">、归还所有操作手册、机密文件和专利资料；<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">c</span><span xss="removed">、向甲方移交“<span lang="EN-US">______</span>卡”会员登记名册；<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">d</span><span xss="removed">、归还、转卖或销毁所有带有“<span lang="EN-US">______</span>”商业标志的招牌和材料；<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">e</span><span xss="removed">、取消以“<span lang="EN-US">______</span>”名义登记的商业注册和名称登记<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">f</span><span xss="removed">、在原加盟店经营场所内外的房屋、设备、陈设等处，消除任何与“<span lang="EN-US">______</span>”有联系的迹象；<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">g</span><span xss="removed">、因加盟店的经营而损害了第三者利益时，由乙方承担赔偿损失的责任。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">4</span><span xss="removed">、甲方因加盟店的行为而被索赔责任时，可要求乙方负担被追索的赔偿金。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">十二、违约责任<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、任何一方不履行或不完全履行本合同条款中规定的义务，即构成违约，违约的一方应承担违约责任。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、双方约定，违约的金额为在此前乙方经销甲方提供的产品零售价总额的<span lang="EN-US">10%</span>。如违约给对方造成损失，并损失超过违约金总额，违约方还应负责对超额部分赔偿责任。违约一方经对方书面提出改正意见后<span lang="EN-US">30</span>天内仍未改正，另一方有权终止合同，并有权要求对方赔偿损失。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">十三、合同纠纷的解决<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">． 本合同在执行过程中产生的任何争议，双方首先应友好协商，协商不成的，双方均有权向深圳市仲裁委员会提起仲裁。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">十四、其它<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">1</span><span xss="removed">、本合同自双方签字盖章之日起生效。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span lang="EN-US" xss="removed">2</span><span xss="removed">、本合同正本一式两份，双方各持一份，每份具有同等法律效力。<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">甲方：<span lang="EN-US">______</span>有限公司 乙方：<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">地址： 地址：<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">电话及传真： 电话及传真：<span lang="EN-US"><o></o></span></span></p><p xss="removed"><span xss="removed">委托代表（签字）： 委托代表（签字）：<span lang="EN-US"><o></o></span></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoNormal"><span lang="EN-US"> </span></p>'),
(10, 1, '命名规范', '<p>请注意，如果你是有linux服务器上开发、安装、使用openant那么文件命名显得十分重要。</p><p>1、所有文件夹名小写</p><p>2、controllers 控制器下的文件首字母必须大写，否则报错</p><p>3、model模型文件名首字母必须大写</p><p>4、view视图所有文件名字母小写</p><p>5、class 类名首字母大写</p>'),
(10, 2, '命名规范', '<p>请注意，如果你是有linux服务器上开发、安装、使用openant那么文件命名显得十分重要。</p><p>1、所有文件夹名小写</p><p>2、controllers 控制器下的文件首字母必须大写，否则报错</p><p>3、model模型文件名首字母必须大写</p><p>4、view视图所有文件名字母小写</p><p>5、class 类名首字母大写</p>'),
(4, 1, '概述', '<h6>蚂蚁开源是什么？</h6><p>蚂蚁开源是由学习php而诞生的多商家、多语言、单用户，强大的商品、订单管理系统的开源项目，项目中多处借鉴opencart的优点，其特性如下：</p><p>1.多商家：支持商家申请入驻，系统自动算结商家帐户，功能类似淘宝，亚马逊。</p><p>2.多语言：你可以为你的商城订制语言，为外贸提供支持。</p><p>3.单用户：商家、管理员、会员、社区论坛一个帐号，单点登陆同步。</p><p>4.商品管理：商家添加商品后可以在自己商家后台管理商品，系统管理员只能查看或处罚商品，不能操作商品。</p><p>5.订单管理：会员可以为某个订单下的单一商品申请退换服务，而不必整单退换。同样管理员只可以查看订单而不能操作订单，商家在自己后台可以操作订单。</p><h6>蚂蚁开源是由创始人xcalder独立开发的电商项目</h6><h6>蚂蚁开源的理想</h6><p>你是否鄙视过ecshop的商业授权？是否反感过商派的加密代码？或者你忍受了opencart不能很好的支持多商家？又或者是opencart没有开发文档？又或者magento框架太大？是否你早已在意淫着有朝一日能诞生一个免费而又强大到爆的电商项目？那么你久违的OpenAnt来了，它完全免费商业授权，为了推动外贸电商的发展。</p><h6>蚂蚁开源（楚雄蚂蚁开源软件工作室）</h6><p>成立于2016年9月的蚂蚁开源软件工作室是伴随着蚂蚁开源项目而诞生的，它在蚂蚁开源项目开始之后成立是因为我觉得这是一个有价值的项目，并且它需要有一个倡导开源的组织来推动和维护，因为它的诞生并不完美。</p><h6>蚂蚁开源名字之由来</h6><p>其实用这个名字来命名我们的开源电商平台项目，只是因为我们实在找不到一个更好的域名了，偶然之间搜索到了openant.com这个域名，之后把它翻译成了中文，</p><h6>蚂蚁本小正如我们但其力无可量</h6>'),
(11, 1, '开发前必读', '<p> 看到这里，说明你已经对我们的项目有点了解，或是想要了解了吧，或者你希望它能为你所使用又或者你想为我们的项目贡献力量，这些都是我们所期待的。</p><p>如果说不能把它推向社区，仍然是由我一个人来维护、开发它，那么我的任务已经完成了。开始我只是想学习php，后来写了一点点东西，再后来就是你现在看到的样子。而我，学习的目的已经达到了，不是吗？从这个角度来说我没有必要再继续花费我的精力了，这个项目也就只是能为了那些想入门CI框架的初学者学习了。</p><p>当一件事的初衷被实现以后，它还有点点价值值得我去再付出一点精力来让它更有价值，那么我愿意，再花费一点精力并且让它永远做为开源项目来使用。</p><p>接下来有很多坑，可能是我在设计时候没想到的，也可能是别的原因一直没能去修复它。希望后来者能把它做的越来越好。把你的插件或者修复的bug提交到主分支，我会在每一版的升级中特别致谢。</p>'),
(12, 1, '在写文档时的一些思考', '这个文档，我不会把它写得细到每个对象方法，因为这样真的很累，我也没有这样的精力来做了，但是我会把每个流程拉出来，如果你没有项目经验，那么放弃吧，你看不懂的。如果你非常了解mvcl 模式，以及面向对象的编程方法那么恭喜，看完文档你就可以上手了，我期待着你的版本。'),
