(50, '官网首页简介', 'custom_html', 'a:3:{s:5:"zh-CN";s:4005:"<div>\r\n<br><h5 class="text-center">Open Ant能做什么？</h5>\r\n\r\n\r\n\r\n<hr>\r\n\r\n\r\n\r\n<br>\r\n\r\n <div class="container">\r\n  <div class="row" id="circle-info">\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-user img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">单用户:商家、管理员、客户都是一个帐号、后台可以管理对应权限，图片为每个用户独立文件夹存储</a></li>\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-book img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">多语言:开始是想重写opencart为多商家商城,写着写着收不住了，加了些更多的功能</a></li>\r\n\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-briefcase img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">订单:系统自动拆分订单，不同商家的商品可以同时加入购物车中，一起结算</a></li>\r\n\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-retweet img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">退换货:有了openant客户再也不需要为了退订单中的一件商品而提交整单退换了，每一件订单商品都对应一个唯一id。</a></li>\r\n\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-lock img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">安全:支付系统需要设置独立的支付密码，进一步保障了客户的资金安全和购物安全</a></li>\r\n\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-gift img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">优惠:平台、商家都可以发放优惠券了，并且在发布商品的时候可以选择是否支持某种优惠券抵扣。</a></li>\r\n\r\n\r\n\r\n\r\n  </div>\r\n\r\n\r\n\r\n  <hr>\r\n\r\n\r\n\r\n  <br>\r\n  <div class="row" id="circle-info">\r\n\r\n  <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-inbox img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">商家：管理商品，管理订单、申请新增品牌、类目，管理退换货,增删运费模板。</a></li>\r\n\r\n\r\n\r\n\r\n  <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-th img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">SKU：单个商品对应多个sku，发布商品可以选择单个sku属性以图片或文字方式显示。</a></li>\r\n\r\n\r\n\r\n\r\n  <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-list img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">类目：商品类目管理员可以直接添加，商家可以申请新增，同时管理员可以指定类目下属性的必填项。</a></li>\r\n\r\n\r\n\r\n\r\n  <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-tint img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">分帐：你可以扩展或在未来的版本中将会增加这个功能，根据设定分成，不能人为干预，自动为平台、商家、推广会员分帐。</a></li>\r\n\r\n\r\n\r\n\r\n  <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-plus img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">插件：插件模块完全继承了opencart的优点，全局可以调用插件展示，插件与系统完全分离。</a></li>\r\n\r\n\r\n\r\n\r\n  <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-th-large img-circle"></i></h2>\r\n\r\n\r\n\r\n\r\n<a class="text-left">模板：只需要加一个判断条件你就可以自由的切换模板了，这将在以后的版本中增加，目前我们觉得这是完全没有必要的，因为伻的模块基本都是插件实现的布局。</a></li>\r\n\r\n\r\n\r\n</div>\r\n\r\n\r\n\r\n </div>\r\n\r\n\r\n\r\n<br><br>\r\n\r\n</div>";s:2:"en";s:3966:"<div class="well well-sm">\r\n<br><h5 class="text-center">Open Ant能做什么？</h5>\r\n\r\n\r\n<hr>\r\n\r\n\r\n<br>\r\n\r\n <div class="container">\r\n  <div class="row" id="circle-info">\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-user img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">单用户:商家、管理员、客户都是一个帐号、后台可以管理对应权限，图片为每个用户独立文件夹存储</a></li>\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-book img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">多语言:开始是想重写opencart为多商家商城,写着写着收不住了，加了些更多的功能</a></li>\r\n\