(63, '技术支持', 'custom_html', 'a:3:{s:5:"zh-CN";s:1828:"<div>\r\n <br><br><br><h4 class="text-center">我们的优势</h4>\r\n\r\n\r\n<br><br>\r\n<hr>\r\n\r\n\r\n<br><br>\r\n\r\n <div class="container">\r\n  <div class="row" id="circle-info">\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-thumbs-up img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">专注:5年来我们只为做一件事，把原生php，和各php框架研究透彻</a></li>\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-briefcase img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">信赖:正规公司，签订正式开发合同，可开正规发票。</a></li>\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-tree-conifer img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">优势:合理利用资源，你在一线城市运筹帷幄，我在四线城市为你保驾护航。</a></li>\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-phone-alt img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">沟通:高效沟通，把你的想法告诉我们，我们为你提供专业的需求文档。</a></li>\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-gift img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">共赢:利用四线城市的人工成本，创造网络时代的无限可能。</a></li>\r\n\r\n\r\n\r\n\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-fullscreen img-circle"></i></h2>\r\n\r\n\r\n\r\n<a class="text-left">开源：我们一直追从开源的精神，你无需支付高额的版权，更节省维护成本。</a></li>\r\n\r\n\r\n\r\n\r\n  </div>\r\n\r\n\r\n\r\n\r\n </div>\r\n\r\n\r\n<br><br>\r\n\r\n</div>";s:2:"en";s:1817:"<div class="well well-sm">\r\n <br><br><br><h4 class="text-center">我们的优势</h4>\r\n\r\n<br><br>\r\n<hr>\r\n\r\n<br><br>\r\n\r\n <div class="container">\r\n  <div class="row" id="circle-info">\r\n   <li class="img-circle col-sm-2 col-xs-6 list-inline text-center"><h2><i class="glyphicon glyphicon-thumbs